import React from "react";
function Body(props) {
  console.log(props);
  // const hanas = props.kyePrac;
  const hanas = props.kyePrac.map((hana) => (
    <div>
      {hana.name},{hana.age}
    </div>
  ));

  return (
    <div>
      <h1>body test</h1>
      <div>
        <h2>Area1</h2>
        {props.title}
        <button onClick={props.updateTitle}>update title</button>
        <br></br>
        {props.number}
        <button onClick={props.updateNum}>update number</button>
        <br></br>
        array props
        {props.array}
        <br />
        array praps index 1
        <br />
        {props.array[1]}
        <br />
        <br />
        props index with tag
        <h3> {props.array[1]} </h3>
        <br />
      </div>
      <div>
        <h2>Area2</h2> map test
        <br />
        {props.numbers}
        {props.numPlus1}
        <br />
        {hanas}
        {/* image test
        {props.img} */}
      </div>
    </div>
  );
}

export default Body;
